import React from 'react';

const NavBar = () => {
    return(
        <div className="ui three item menu">
            <a className="active item">Editorials</a>
            <a className="item">Reviews</a>
            <a className="item">Upcoming Events</a>
        </div>
    )
}

export default NavBar
